import { useStore } from '../hooks/useStore'

import ImageItem from './ImageItem'

export default function MasterKey(props) {
  const lang = useStore((state) => state.lang)

  return (
    <ImageItem
      item={{
        src: `/textures/logo${lang}.png`,
      }}
      scale={[0.5, 0.5, 1]}
      index={100}
      {...props}
    />
  )
}

